#include<iostream>
#include<vector>
#include<string>
 
using namespace std;

/*
总共有 n 个颜色片段排成一列，每个颜色片段要么是 'A'
要么是 'B' 。给你一个长度为 n 的字符串 colors ，其中 colors[i] 表示第 i 个颜色片段的颜色。

Alice 和 Bob 在玩一个游戏，他们 轮流 从这个字符串中删除颜色。Alice 先手 。

如果一个颜色片段为 'A' 且 相邻两个颜色 都是颜色 'A' ，
那么 Alice 可以删除该颜色片段。Alice 不可以 删除任何颜色 'B' 片段。
如果一个颜色片段为 'B' 且 相邻两个颜色 都是颜色 'B' ，
那么 Bob 可以删除该颜色片段。Bob 不可以 删除任何颜色 'A' 片段。
Alice 和 Bob 不能 从字符串两端删除颜色片段。
如果其中一人无法继续操作，则该玩家 输 掉游戏且另一玩家 获胜 。
假设 Alice 和 Bob 都采用最优策略，如果 Alice 获胜，请返回 true，否则 Bob 获胜，返回 false。
*/


/*

分别统计 Alice 可删除的 A 的数量 (acnt) 和 Bob 可删除的 B 的数量 (bcnt)~

由题意易知：

当 acnt > bcnt 时，Alice 必胜，Bob 必败；

当 acnt <= bcnt 时，Alice 必败，Bob 必
*/

class Solution {
public:
    bool winnerOfGame(string colors) {
        if(colors.size() < 3) return false;
        bool flag = true;
        if(colors.find("AAA") != string::npos){
            int index = colors.find("AAA");
            colors.erase(colors.begin() + index +1);
        }else{
            return false;
        }
        while(colors.find("BBB") != string::npos){
            int index = colors.find("BBB");
            colors.erase(colors.begin() + index +1);
            if(colors.find("AAA") != string::npos){
                int index2 = colors.find("AAA");
                colors.erase(colors.begin() + index2 +1);
            }else{
                return false;
            }
        }
        return true;
    }
};


class Solution2 {
public:
    bool winnerOfGame(string colors) {
        int cnt = 0;
        int n = colors.size();
        for(int i = 1;i<n-1;i++){
            if(colors[i] == colors[i-1] && colors[i] == colors[i+1])
                cnt += colors[i] == 'A' ? 1:-1;
        }
        return cnt > 0;
    }
};


int main(int argc, char const *argv[])
{
    string::size_type index;
    string colors = "";
    Solution2 sol;
    cout<<sol.winnerOfGame(colors)<<endl;

    system("pause");
    return 0;
}
